import "../css/aDaySkyPhoto.css";

function ADaySkyPhotoSmall(props) {
  return (
    <div>
      <img
        className="skyPhoto"
        src={process.env.PUBLIC_URL + "photos/20210601.jpg"}
        alt="."
      ></img>
    </div>
  );
}

export default ADaySkyPhotoSmall;
